export default function CMS(){
    return(
        <div className="cms-wrapper">
                <div className="cms-head">
                    <h1></h1>
                    <div className="cms-buttons">
                        <SecondaryButton />
                        <SecondaryButton />
                    </div>
                </div>
                <NewsPanel 
